import './css/navmain.css';

const navmain = (svg1) => {
    return (
        <div>
            <section className='navmain'>
                <div>
                    {svg1}
                    <p>Amigos</p>
                </div>
            </section>
        </div>
    )
}

navmain.defaultProps = {
    svg1: 'Hello',

}

export default navmain
